INSERT INTO `pcmappv2_activity` VALUES (1,'PCM Annual Trip 2018','2018-07-27','Swiss Garden Beach Resort Damai Laut','PCM Annual Trip this year was held at Swiss Garden Beach Resort Damai Laut from 27th-29th July 2018. A total of 35 Peugeot vehicles of different models attended the trip this year. The club would like to thank all members who attended and also our sponsors for making this a memorable annual trip. Join us today if you\'re interested to join our upcoming activities! #GECarriage #GoodyearMalaysia #McClubz #MeguiarsMalaysia #BOTC2018','https://www.facebook.com/pg/PeugeotClubMalaysia/photos/?tab=album&album_id=1745022942214189',NULL,'2018-09-11 17:36:18.000000','static/images/annualtrip.JPG'),(2,'Day Drive to Fraser\'s Hill','2018-04-21','Frasers Hill','Peugeot Club Malaysia had its first day drive of the year to Fraser\'s Hill. A total of 11 Peugeot of various models participated in the drive which started from R&R Sungai Buloh. We had a short pit stop at Empangan Sungai Selangor for a photoshoot before continuing our journey to Fraser\'s Hill. Our cars perform exceptionally well along the winding roads of Kuala Kubu Bharu without any issues. Enjoy the photos from our event and join us for the next drive!','https://www.facebook.com/pg/PeugeotClubMalaysia/photos/?tab=album&album_id=1584701541579664',NULL,'2018-09-11 17:40:39.000000','static/images/daydrivefraser.jpg'),(3,'Battle of The Clubs 2018 - Round 2 Paintball','2018-07-15','Goodyear Malaysia','Goodyear Malaysia Battle of the Clubs 2018 organized by MCCLUBZ Congratulations PCM for clinching 6th place in the second round of BOTC\'18. Come support our team in the upcoming challenges! #GoodyearMalaysia #McClubz #BOTC2018','https://www.facebook.com/pg/PeugeotClubMalaysia/photos/?tab=album&album_id=1709636932419457',NULL,'2018-07-16 04:00:00.000000','static/images/38670927_1709637012419449_958662470270976000_n.jpg');
